import React, { Component } from "react";

export class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {}
  render() {
    return (
      <div className="inner-container">
        <div className="header">Login</div>
        <div className="box">
          <div className="input-group">
            <label className="login-label" for="username">
              Username
            </label>
            <input className="login-input" type="text" id="username"></input>
          </div>
          <div className="input-group">
            <label className="login-label" for="password">
              Password
            </label>
            <input className="login-input" type="password" id="password"></input>
          </div>
          {/* <button className="login-btn" onClick={this.handleClick}>
            Login
          </button> */
          <input type="submit" value="Log "></input>}
        </div>
      </div>
    );
  }
}
